INSERT INTO `glpi_tickets` VALUES ('42','0','Falta de servicio de Fax 5272-6138 - OSPEGAP','2016-08-11 15:08:27','2016-08-18 15:44:38','2016-08-18 15:44:34','2016-08-18 15:44:38','12','6','12','1','Hace alrededor de una semana, estamos teniendo inconvenientes con esta línea perteneciente a un Fax virtual. El inconveninte está en que no recibe ningún tipo de llamadas por ende ningún fax. Si se llama desde alguna línea del mismo grupo de números, al llamar da \"ocupado\". Pero si se llama de un teléfono de línea, queda mudo. 
